import React from "react";
const SecondTab = () => {
  return (
    <div className="SecondTab">
      <p>Second Tab</p>
      {/* Second  tab content will go here */}
        <Container maxWidth={"sm"} id="calculatorform">
                                    <Card id="formTwo" >
                                        <CardHeader title={"Loan Calculator"} class="heading"/>
                                        <CardHeader title={msgTwo} className="msg" titleTypographyProps={{variant:'h6' }}/>
                                        <CardContent >
                                            <form onSubmit={handleLogin}>

                                                        <TextField
                                                            variant="outlined"
                                                            placeholder={"Loan Amount"}
                                                            fullWidth
                                                            className="field"
                                                            decimalsLimit={2}
                                                            onValueChange={(value, name) => console.log(value, name)}
                                                            prefix="$"
                                                        />
                                                        <TextField
                                                            variant="outlined"
                                                            placeholder={"Loan Term"}
                                                            fullWidth
                                                            className="field"
                                                            decimalsLimit={2}
                                                            onValueChange={(value, name) => console.log(value, name)}
                                                            prefix="$"
                                                        />
                                                        <TextField
                                                            variant="outlined"
                                                            placeholder={"Interest Rates"}
                                                            fullWidth
                                                            className="field"
                                                            decimalsLimit={2}
                                                            onValueChange={(value, name) => console.log(value, name)}
                                                            prefix="$"
                                                        />
                                                       <Button type="submit" id="loginButtonTwo"> Submit</Button>
                                                       <Button type="reset" value="Reset" id="loginButtonTwo"> Clear</Button>
                                            </form>
                                        </CardContent>
                                    </Card>
                    </Container>
    </div>
  );
};
export default SecondTab;
